import React, { useState, useEffect, useRef } from 'react';
import { Heart, Zap, Shield, Star } from 'lucide-react';

export default function LoveShooter() {
  const canvasRef = useRef(null);
  const [gameState, setGameState] = useState('menu');
  const [score, setScore] = useState(0);
  const [highScore, setHighScore] = useState(0);
  const [level, setLevel] = useState(1);
  const [imagesLoaded, setImagesLoaded] = useState(false);
  const playerImgRef = useRef(null);
  const enemyImgRef = useRef(null);
  const gameLoopRef = useRef(null);
  const keysRef = useRef({});

  // Load images
  useEffect(() => {
    const playerImg = new Image();
    const enemyImg = new Image();
    
    playerImg.src = 'data:image/png;base64,';
    enemyImg.src = 'data:image/png;base64,';
    
    let loadedCount = 0;
    const checkLoaded = () => {
      loadedCount++;
      if (loadedCount === 2) {
        playerImgRef.current = playerImg;
        enemyImgRef.current = enemyImg;
        setImagesLoaded(true);
      }
    };
    
    playerImg.onload = checkLoaded;
    enemyImg.onload = checkLoaded;
  }, []);

  useEffect(() => {
    const canvas = canvasRef.current;
    if (!canvas || gameState !== 'playing' || !imagesLoaded) return;

    const ctx = canvas.getContext('2d');
    canvas.width = 800;
    canvas.height = 600;

    const player = {
      x: canvas.width / 2 - 25,
      y: canvas.height - 80,
      width: 50,
      height: 50,
      speed: 5,
      health: 3,
      maxHealth: 3,
      shield: false,
      shieldTime: 0
    };

    const bullets = [];
    const enemies = [];
    const powerUps = [];
    const particles = [];

    let enemySpawnTimer = 0;
    let powerUpSpawnTimer = 0;
    let currentScore = 0;
    let currentLevel = 1;

    const handleKeyDown = (e) => {
      keysRef.current[e.key] = true;
      if (e.key === ' ') {
        e.preventDefault();
        shootBullet();
      }
      if (e.key === 'Escape') {
        setGameState('paused');
      }
    };

    const handleKeyUp = (e) => {
      keysRef.current[e.key] = false;
    };

    window.addEventListener('keydown', handleKeyDown);
    window.addEventListener('keyup', handleKeyUp);

    const shootBullet = () => {
      bullets.push({
        x: player.x + player.width / 2 - 5,
        y: player.y,
        width: 10,
        height: 20,
        speed: 8,
        type: 'heart'
      });
    };

    const spawnEnemy = () => {
      const types = ['type1', 'type2', 'type3'];
      const type = types[Math.floor(Math.random() * types.length)];
      enemies.push({
        x: Math.random() * (canvas.width - 40),
        y: -50,
        width: 40,
        height: 40,
        speed: 1 + currentLevel * 0.3,
        health: type === 'type1' ? 2 : 1,
        type: type
      });
    };

    const spawnPowerUp = () => {
      const types = ['shield', 'health'];
      const type = types[Math.floor(Math.random() * types.length)];
      powerUps.push({
        x: Math.random() * (canvas.width - 30),
        y: -30,
        width: 30,
        height: 30,
        speed: 2,
        type: type
      });
    };

    const createParticles = (x, y, color, count = 10) => {
      for (let i = 0; i < count; i++) {
        particles.push({
          x: x,
          y: y,
          vx: (Math.random() - 0.5) * 6,
          vy: (Math.random() - 0.5) * 6,
          size: Math.random() * 4 + 2,
          color: color,
          life: 30
        });
      }
    };

    const checkCollision = (obj1, obj2) => {
      return obj1.x < obj2.x + obj2.width &&
             obj1.x + obj1.width > obj2.x &&
             obj1.y < obj2.y + obj2.height &&
             obj1.y + obj1.height > obj2.y;
    };

    const drawHeart = (ctx, x, y, size, color) => {
      ctx.fillStyle = color;
      ctx.beginPath();
      const topCurveHeight = size * 0.3;
      ctx.moveTo(x, y + topCurveHeight);
      ctx.bezierCurveTo(x, y, x - size / 2, y, x - size / 2, y + topCurveHeight);
      ctx.bezierCurveTo(x - size / 2, y + (size + topCurveHeight) / 2, x, y + (size + topCurveHeight) / 1.3, x, y + size);
      ctx.bezierCurveTo(x, y + (size + topCurveHeight) / 1.3, x + size / 2, y + (size + topCurveHeight) / 2, x + size / 2, y + topCurveHeight);
      ctx.bezierCurveTo(x + size / 2, y, x, y, x, y + topCurveHeight);
      ctx.fill();
    };

    const drawPlayer = () => {
      if (playerImgRef.current) {
        ctx.save();
        ctx.beginPath();
        ctx.arc(player.x + 25, player.y + 25, 25, 0, Math.PI * 2);
        ctx.clip();
        ctx.drawImage(playerImgRef.current, player.x, player.y, player.width, player.height);
        ctx.restore();
      }

      if (player.shield) {
        ctx.strokeStyle = '#00FFFF';
        ctx.lineWidth = 3;
        ctx.beginPath();
        ctx.arc(player.x + 25, player.y + 25, 35, 0, Math.PI * 2);
        ctx.stroke();
      }
    };

    const drawBullet = (bullet) => {
      drawHeart(ctx, bullet.x + 5, bullet.y, 10, '#FF69B4');
    };

    const drawEnemy = (enemy) => {
      if (enemyImgRef.current) {
        ctx.save();
        ctx.beginPath();
        ctx.arc(enemy.x + 20, enemy.y + 20, 20, 0, Math.PI * 2);
        ctx.clip();
        ctx.drawImage(enemyImgRef.current, enemy.x, enemy.y, enemy.width, enemy.height);
        ctx.restore();
        
        if (enemy.health > 1) {
          ctx.fillStyle = '#FFD700';
          ctx.font = 'bold 16px Arial';
          ctx.fillText(enemy.health, enemy.x + 15, enemy.y - 5);
        }
      }
    };

    const drawPowerUp = (powerUp) => {
      ctx.save();
      ctx.translate(powerUp.x + 15, powerUp.y + 15);
      ctx.rotate(Date.now() / 500);
      
      if (powerUp.type === 'shield') {
        ctx.strokeStyle = '#00FFFF';
        ctx.lineWidth = 3;
        ctx.beginPath();
        ctx.arc(0, 0, 12, 0, Math.PI * 2);
        ctx.stroke();
      } else if (powerUp.type === 'health') {
        drawHeart(ctx, 0, 0, 15, '#FF0000');
      }
      ctx.restore();
    };

    const update = () => {
      if (keysRef.current['ArrowLeft'] || keysRef.current['a']) {
        player.x = Math.max(0, player.x - player.speed);
      }
      if (keysRef.current['ArrowRight'] || keysRef.current['d']) {
        player.x = Math.min(canvas.width - player.width, player.x + player.speed);
      }
      if (keysRef.current['ArrowUp'] || keysRef.current['w']) {
        player.y = Math.max(0, player.y - player.speed);
      }
      if (keysRef.current['ArrowDown'] || keysRef.current['s']) {
        player.y = Math.min(canvas.height - player.height, player.y + player.speed);
      }

      if (player.shield) {
        player.shieldTime--;
        if (player.shieldTime <= 0) {
          player.shield = false;
        }
      }

      for (let i = bullets.length - 1; i >= 0; i--) {
        bullets[i].y -= bullets[i].speed;
        if (bullets[i].y < -20) {
          bullets.splice(i, 1);
        }
      }

      for (let i = enemies.length - 1; i >= 0; i--) {
        enemies[i].y += enemies[i].speed;
        
        if (checkCollision(player, enemies[i])) {
          if (player.shield) {
            createParticles(enemies[i].x + 20, enemies[i].y + 20, '#00FFFF');
            enemies.splice(i, 1);
          } else {
            player.health--;
            createParticles(enemies[i].x + 20, enemies[i].y + 20, '#FF0000');
            enemies.splice(i, 1);
            
            if (player.health <= 0) {
              setGameState('gameover');
              if (currentScore > highScore) {
                setHighScore(currentScore);
              }
            }
          }
          continue;
        }

        for (let j = bullets.length - 1; j >= 0; j--) {
          if (i < enemies.length && checkCollision(bullets[j], enemies[i])) {
            enemies[i].health--;
            bullets.splice(j, 1);
            
            if (enemies[i].health <= 0) {
              currentScore += 10;
              setScore(currentScore);
              createParticles(enemies[i].x + 20, enemies[i].y + 20, '#FFD700', 15);
              enemies.splice(i, 1);
              
              if (currentScore % 100 === 0 && currentScore > 0) {
                currentLevel++;
                setLevel(currentLevel);
              }
            }
            break;
          }
        }

        if (i >= 0 && enemies[i] && enemies[i].y > canvas.height) {
          enemies.splice(i, 1);
        }
      }

      for (let i = powerUps.length - 1; i >= 0; i--) {
        powerUps[i].y += powerUps[i].speed;
        
        if (checkCollision(player, powerUps[i])) {
          if (powerUps[i].type === 'shield') {
            player.shield = true;
            player.shieldTime = 300;
          } else if (powerUps[i].type === 'health') {
            player.health = Math.min(player.maxHealth, player.health + 1);
          }
          createParticles(powerUps[i].x + 15, powerUps[i].y + 15, '#FFD700');
          powerUps.splice(i, 1);
          continue;
        }

        if (powerUps[i].y > canvas.height) {
          powerUps.splice(i, 1);
        }
      }

      for (let i = particles.length - 1; i >= 0; i--) {
        particles[i].x += particles[i].vx;
        particles[i].y += particles[i].vy;
        particles[i].life--;
        if (particles[i].life <= 0) {
          particles.splice(i, 1);
        }
      }

      enemySpawnTimer++;
      if (enemySpawnTimer > Math.max(60 - currentLevel * 5, 20)) {
        spawnEnemy();
        enemySpawnTimer = 0;
      }

      powerUpSpawnTimer++;
      if (powerUpSpawnTimer > 600) {
        spawnPowerUp();
        powerUpSpawnTimer = 0;
      }
    };

    const render = () => {
      const gradient = ctx.createLinearGradient(0, 0, 0, canvas.height);
      gradient.addColorStop(0, '#FFB6D9');
      gradient.addColorStop(1, '#FFC0E5');
      ctx.fillStyle = gradient;
      ctx.fillRect(0, 0, canvas.width, canvas.height);

      ctx.fillStyle = 'rgba(255, 192, 203, 0.3)';
      for (let i = 0; i < 5; i++) {
        const offset = (Date.now() / 1000 + i) % canvas.height;
        drawHeart(ctx, 50 + i * 150, offset, 20, 'rgba(255, 192, 203, 0.3)');
      }

      particles.forEach(particle => {
        ctx.fillStyle = particle.color;
        ctx.globalAlpha = particle.life / 30;
        ctx.fillRect(particle.x, particle.y, particle.size, particle.size);
      });
      ctx.globalAlpha = 1;

      bullets.forEach(drawBullet);
      enemies.forEach(drawEnemy);
      powerUps.forEach(drawPowerUp);
      drawPlayer();

      ctx.fillStyle = '#FF1493';
      ctx.font = 'bold 24px Arial';
      ctx.fillText(`Score: ${currentScore}`, 20, 40);
      ctx.fillText(`Level: ${currentLevel}`, 20, 70);

      for (let i = 0; i < player.maxHealth; i++) {
        if (i < player.health) {
          drawHeart(ctx, 680 + i * 35, 20, 20, '#FF0000');
        } else {
          drawHeart(ctx, 680 + i * 35, 20, 20, '#CCCCCC');
        }
      }
    };

    const gameLoop = () => {
      update();
      render();
      gameLoopRef.current = requestAnimationFrame(gameLoop);
    };

    gameLoop();

    return () => {
      window.removeEventListener('keydown', handleKeyDown);
      window.removeEventListener('keyup', handleKeyUp);
      if (gameLoopRef.current) {
        cancelAnimationFrame(gameLoopRef.current);
      }
    };
  }, [gameState, highScore, imagesLoaded]);

  const startGame = () => {
    setScore(0);
    setLevel(1);
    setGameState('playing');
  };

  if (gameState === 'menu') {
    if (!imagesLoaded) {
      return (
        <div className="min-h-screen bg-gradient-to-br from-pink-200 via-red-200 to-purple-200 flex items-center justify-center p-4">
          <div className="text-center">
            <Heart className="w-16 h-16 mx-auto mb-4 text-red-500 animate-pulse" fill="currentColor" />
            <p className="text-2xl text-gray-800 font-bold">Loading images...</p>
          </div>
        </div>
      );
    }

    return (
      <div className="min-h-screen bg-gradient-to-br from-pink-200 via-red-200 to-purple-200 flex items-center justify-center p-4">
        <div className="max-w-xl w-full bg-white rounded-3xl shadow-2xl p-12 text-center">
          <Heart className="w-24 h-24 mx-auto mb-6 text-red-500 animate-pulse" fill="currentColor" />
          <h1 className="text-5xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-pink-600 to-red-600 mb-4">
            RaiGel Shooter 
          </h1>
          <p className="text-lg text-gray-700 mb-8">
            Shoot Hearts to Rainer Before he eat you!
          </p>
          
          <div className="bg-pink-50 rounded-2xl p-6 mb-8 text-left">
            <h3 className="font-bold text-gray-800 mb-3 text-center">How to Play:</h3>
            <ul className="space-y-2 text-gray-700">
              <li> <span className="font-semibold">Move:</span> Arrow Keys or WASD</li>
              <li> <span className="font-semibold">Shoot:</span> Spacebar</li>
              <li> <span className="font-semibold">Goal:</span> Don't let him reach you!</li>
              <li> <span className="font-semibold">Collect:</span> Power-ups for shields and health</li>
            </ul>
          </div>

          {highScore > 0 && (
            <p className="text-xl text-pink-600 font-bold mb-4">
              High Score: {highScore} 
            </p>
          )}

          <button
            onClick={startGame}
            className="bg-gradient-to-r from-pink-500 to-red-500 text-white px-12 py-4 rounded-full text-xl font-bold hover:from-pink-600 hover:to-red-600 transform hover:scale-105 transition-all shadow-lg"
          >
            Start Game 
          </button>

          <p className="mt-6 text-sm text-gray-600 italic">
            Made with love for Valentine's Day 
          </p>
        </div>
      </div>
    );
  }

  if (gameState === 'paused') {
    return (
      <div className="min-h-screen bg-gradient-to-br from-pink-200 via-red-200 to-purple-200 flex items-center justify-center p-4">
        <div className="max-w-md w-full bg-white rounded-3xl shadow-2xl p-12 text-center">
          <h2 className="text-4xl font-bold text-gray-800 mb-6">Paused</h2>
          <p className="text-xl text-gray-600 mb-4">Score: {score}</p>
          <p className="text-xl text-gray-600 mb-8">Level: {level}</p>
          <button
            onClick={() => setGameState('playing')}
            className="bg-gradient-to-r from-pink-500 to-red-500 text-white px-8 py-3 rounded-full text-lg font-bold hover:from-pink-600 hover:to-red-600 mb-4 w-full"
          >
            Resume
          </button>
          <button
            onClick={() => setGameState('menu')}
            className="bg-gray-200 text-gray-700 px-8 py-3 rounded-full text-lg font-bold hover:bg-gray-300 w-full"
          >
            Main Menu
          </button>
        </div>
      </div>
    );
  }

  if (gameState === 'gameover') {
    return (
      <div className="min-h-screen bg-gradient-to-br from-pink-200 via-red-200 to-purple-200 flex items-center justify-center p-4">
        <div className="max-w-md w-full bg-white rounded-3xl shadow-2xl p-12 text-center">
          <h2 className="text-4xl font-bold text-gray-800 mb-6">Game Over!</h2>
          <p className="text-2xl text-pink-600 font-bold mb-2">Final Score: {score}</p>
          <p className="text-xl text-gray-600 mb-2">Level Reached: {level}</p>
          {score > highScore && (
            <p className="text-lg text-green-600 font-bold mb-6"> New High Score! </p>
          )}
          {score <= highScore && highScore > 0 && (
            <p className="text-lg text-gray-600 mb-6">High Score: {highScore}</p>
          )}
          <button
            onClick={startGame}
            className="bg-gradient-to-r from-pink-500 to-red-500 text-white px-8 py-3 rounded-full text-lg font-bold hover:from-pink-600 hover:to-red-600 mb-4 w-full"
          >
            Play Again
          </button>
          <button
            onClick={() => setGameState('menu')}
            className="bg-gray-200 text-gray-700 px-8 py-3 rounded-full text-lg font-bold hover:bg-gray-300 w-full"
          >
            Main Menu
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gradient-to-br from-pink-200 via-red-200 to-purple-200 flex flex-col items-center justify-center p-4">
      <div className="mb-4 text-center">
        <p className="text-white text-sm">Press ESC to pause</p>
      </div>
      <canvas
        ref={canvasRef}
        className="rounded-2xl shadow-2xl border-4 border-white"
      />
    </div>
  );
}
